import Header from './Header'

const layoutStyle = {
  backgroundColor : "black",
}

export default function Layout(props) {
  return (
    <div style={layoutStyle}>
      <Header />
      {props.children}
      <style jsx>{`
        div
        {
          background-image : url("https://instagram.fbom3-1.fna.fbcdn.net/vp/0ad88351e4498360151bd97cbb1acacd/5D700509/t51.2885-15/sh0.08/e35/s750x750/50717724_2051558481599094_8552240087813895815_n.jpg?_nc_ht=instagram.fbom3-1.fna.fbcdn.net");
          background-position : center;
          background-size : cover;
        }
        `}</style>

    </div>
  )
}
